- input: "TEXT\x1CC00450692\x1C.TEXT\x1C\x1CF3XN\x1CSchedule D discloses multiple
    debts owed to Poet, LLC. Please be advised that Poet PAC did not intend for its
    sponsoring organization to make the payments to these vendors. However, Poet,
    LLC inadvertently paid these invoices. Poet PAC reimbursed Poet, LLC for these
    expenses as soon as possible. Furthermore, on the 2008 Year-End Report, POET PAC
    reported a $5,000 in-kind contribution from POET LLC.  However, this $5,000 contribution
    was actually debt incurred by POET PAC.  Please be advised that POET PAC has amended
    its 2008 Year-End Report to remove the in-kind contribution and reflect the change
    in the debt.                                                                                                                                                                                                                                                                                                                                                                                                                                                 Please
    be advised that Schedule A discloses a contribution from Jeff Broin for $5,000.
    \ Please be further advised that in July, 2009 POET PAC received permission to
    reattribute Jeff Broin's contribution to his wife, Tammie Broin.  This reattribution
    will be reported on POET PAC's Year-End Report.\n"
